import './App.css';
import state from './state';
import Header from './components/Header/Header';
import Navbar from './components/Navbar/Navbar';
import Periods from './components/Periods/Periods'
import {Routes} from './routes';
import {LEAGUES} from './state';

const SECTIONS = [
    { title: 'Список лиг', href: '/leagues'},
    { title: 'Расписание лиги' ,  href: '/leagueSchedule'  },
    { title: 'Команды',  href: '/teams' },
    { title: 'Расписание команды',  href: '/teamSchedule' },
  ];

const App = (props ) => { 
console.log(LEAGUES);
    return(   
        <div className="app-wrapper">
          <Header/> 
          <Navbar period={props.state.period} sections={SECTIONS}/> 
          <Periods period={props.state.period} setPeriod={props.setPeriod}/>
          <div className="app-wrapper-content">
            <Routes period={props.state.period } leagues={LEAGUES}/>
          </div>    
        </div>
    );//return  
}//class

export default App;
